        title={props.data[2].title}
        prise={props.data[2].prise}
        date={props.data[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={props.data[3].title}
        prise={props.data[3].prise}
        date={props.data[3].date}
      ></ExpenseItem>
    </Card>
  );
}

export default Expenses;
